    class Sys {
        companion object {
            fun Fragment.hideKeyboard() {
                view?.let { activity?.hideKeyboard(it) }
            }

            fun Activity.hideKeyboard() {
                hideKeyboard(currentFocus ?: View(this))
            }

            fun Context.hideKeyboard(view: View) {
                val inputMethodManager = getSystemService(Activity.INPUT_METHOD_SERVICE) as InputMethodManager
                inputMethodManager.hideSoftInputFromWindow(view.windowToken, 0)
            }
        }
    }
    class Data {
        companion object {
            val allowedChars = ('A'..'Z') + ('a'..'z') + ('0'..'9')
            val cyrChar = ('А'..'Я') + ('А'..'я')
            fun generateStringNumber(length: Int): String {
                val allowedNums = ('0'..'9')
                return (1..length)
                    .map { allowedNums.random() }
                    .joinToString("")
            }
            fun generateString(length: Int) : String {
                return (1..length)
                    .map { allowedChars.random() }
                    .joinToString("")
            }
            fun String.formatString(): String {
                var formatted = ""
                this.trimEnd().trim().forEach {
                    formatted += when (it) {
                        in allowedChars -> it
                        in cyrChar -> when (it) {
                            'А', 'а' -> 'a'
                            'Б', 'б' -> 'b'
                            'В', 'в' -> 'v'
                            'Г', 'г' -> 'g'
                            'Д', 'д' -> 'd'
                            'Е', 'е' -> 'e'
                            'Ё', 'ё' -> 'e'
                            'Ж', 'ж' -> 'j'
                            'З', 'з' -> 'z'
                            'И', 'и' -> 'i'
                            'Й', 'й' -> "ii"
                            'К', 'к' -> 'k'
                            'Л', 'л' -> 'l'
                            'М', 'м' -> 'm'
                            'Н', 'н' -> 'n'
                            'О', 'о' -> 'o'
                            'П', 'п' -> 'p'
                            'Р', 'р' -> 'r'
                            'С', 'с' -> 's'
                            'Т', 'т' -> 't'
                            'У', 'у' -> 'y'
                            'Ф', 'ф' -> 'f'
                            'Х', 'х' -> 'h'
                            'Ц', 'ц' -> 'c'
                            'Ч', 'ч' -> "ch"
                            'Ш', 'ш' -> "sh"
                            'Щ', 'щ' -> "sh"
                            'Ъ', 'ъ' -> ""
                            'Ы', 'ы' -> 'i'
                            'Ь', 'ь' -> ""
                            'Э', 'э' -> 'e'
                            'Ю', 'ю' -> 'u'
                            'Я', 'я' -> "ya"
                            else -> "_"
                        }
                        else -> "_"
                    }
                }
                return formatted
            }
            fun Byte.byteToHexString(): String {
                return (this.toInt() and 0xFF).toString(16).padStart(2, '0')
            }
            fun Int.colorToHex(): String {
                return String.format("%02x%02x%02x", Color.red(this), Color.green(this), Color.blue(this))
            }
        }
    }
