    class Animations {
        companion object {
            private val decelerateInterpolator = DecelerateInterpolator(3.0f)

            //Up to down dialog appearing
            fun View.upToDownAppear() {
                this.visibility = View.VISIBLE
                this.translationY = -100f
                this.alpha = 0f
                this.animate().let {
                    it.duration = 250
                    it.interpolator = DecelerateInterpolator(2.0f)
                    it.translationY(0f)
                    it.alpha(1f)
                    it.setListener(object : AnimatorListener {
                        override fun onAnimationStart(animation: Animator) {}
                        override fun onAnimationEnd(animation: Animator) {}
                        override fun onAnimationCancel(animation: Animator) {}
                        override fun onAnimationRepeat(animation: Animator) {}
                    })
                    it.start()
                }
            }
            fun View.downToTopDisappear(onEnd: Runnable?) {
                this.visibility = View.VISIBLE
                this.animate().let {
                    it.duration = 250
                    it.interpolator = DecelerateInterpolator(2.0f)
                    it.translationY(-100f)
                    it.alpha(0f)
                    it.setListener(object : AnimatorListener {
                        override fun onAnimationStart(animation: Animator) {}
                        override fun onAnimationEnd(animation: Animator) { onEnd?.run() }
                        override fun onAnimationCancel(animation: Animator) {}
                        override fun onAnimationRepeat(animation: Animator) {}
                    })
                    it.start()
                }
            }

            private const val scaledState = 1.1f
            private const val scaleDuration = 400L
            //Standart dialogs animations
            fun View.scaleAppear() {
                this.visibility = View.VISIBLE
                this.scaleX = scaledState
                this.scaleY = scaledState
                this.alpha = 0f
                this.animate().let {
                    it.duration = scaleDuration
                    it.interpolator = decelerateInterpolator
                    it.scaleX(1f)
                    it.scaleY(1f)
                    it.alpha(1f)
                    it.setListener(object : AnimatorListener {
                        override fun onAnimationStart(animation: Animator) {}
                        override fun onAnimationEnd(animation: Animator) {}
                        override fun onAnimationCancel(animation: Animator) {}
                        override fun onAnimationRepeat(animation: Animator) {}
                    })
                    it.start()
                }
            }
            fun View.scaleDisappear(onEnd: Runnable?) {
                this.visibility = View.VISIBLE
                this.scaleX = 1f
                this.scaleY = 1f
                this.alpha = 1f
                this.animate().let {
                    it.duration = scaleDuration
                    it.interpolator = decelerateInterpolator
                    it.scaleX(scaledState)
                    it.scaleY(scaledState)
                    it.alpha(0f)
                    it.setListener(object : AnimatorListener {
                        override fun onAnimationStart(animation: Animator) {}
                        override fun onAnimationEnd(animation: Animator) { onEnd?.run() }
                        override fun onAnimationCancel(animation: Animator) {}
                        override fun onAnimationRepeat(animation: Animator) {}
                    })
                    it.start()
                }
            }

            //Blur animations
            private const val enabledRadius = 15f
            private const val blurAnimDuration = 250
            private const val blurAnimationFrameDelay = 50
            fun BlurView.animateEnable() {
                this.visibility = View.VISIBLE
                this.setBlurRadius(0.01f)
                this.setBlurEnabled(true)
                ValueAnimator.ofFloat(0.01f, enabledRadius).let {
                    it.duration = blurAnimDuration.toLong()
                    it.interpolator = DecelerateInterpolator()
                    it.addListener(object: AnimatorListener {
                        override fun onAnimationStart(p0: Animator) {}
                        override fun onAnimationEnd(p0: Animator) {this@animateEnable.invalidate()}
                        override fun onAnimationCancel(p0: Animator) {}
                        override fun onAnimationRepeat(p0: Animator) {}
                    })
                    it.addUpdateListener { animation -> this.setBlurRadius(animation.animatedValue as Float); this.setBlurEnabled(true) }
                    it.start()
                }
            }
            fun BlurView.animateDisable(onEnd: Runnable?) {
                this@animateDisable.visibility = View.VISIBLE
                val step = enabledRadius / ((blurAnimDuration-100).toFloat() / blurAnimationFrameDelay.toFloat())
                var currentRadius = enabledRadius

                val timer = object: CountDownTimer(blurAnimDuration-100.toLong(), blurAnimationFrameDelay.toLong()) {
                    override fun onTick(millisUntilFinished: Long) {
                        this@animateDisable.setBlurRadius(currentRadius.let {if (it <= 0f) 0.01f else it})
                        this@animateDisable.setBlurEnabled(true)
                        currentRadius -= step
                    }
                    override fun onFinish() {
                        this@animateDisable.setBlurRadius(0.001f)
                        this@animateDisable.setBlurEnabled(true)
                        this@animateDisable.animate().let {
                            it.duration = 85
                            it.alpha(0f)
                            it.interpolator = decelerateInterpolator
                            it.setListener(object : AnimatorListener {
                                override fun onAnimationStart(animation: Animator) {}
                                override fun onAnimationEnd(animation: Animator) { onEnd?.run(); this@animateDisable.alpha = 1f; this@animateDisable.setBlurEnabled(false) }
                                override fun onAnimationCancel(animation: Animator) {}
                                override fun onAnimationRepeat(animation: Animator) {}
                            })
                            it.start()
                        }
                    }
                }
                timer.start()
            }

