            //Highlights
            fun View.highlightAnimate() {
                this.animate().let {
                    it.duration = 400
                    it.interpolator = decelerateInterpolator
                    it.scaleX(1.2f)
                    it.scaleY(1.2f)
                    it.setListener(object: AnimatorListener {
                        override fun onAnimationStart(p0: Animator) {}
                        override fun onAnimationEnd(p0: Animator) {
                            this@highlightAnimate.animate().let {
                                it.duration = 400
                                it.interpolator = AccelerateInterpolator(4f)
                                it.scaleX(1f)
                                it.scaleY(1f)
                                it.setListener(object: AnimatorListener {
                                    override fun onAnimationStart(p0: Animator) {}
